DROP TABLE IF EXISTS `t_vcar_applicant`;
CREATE TABLE `t_vcar_applicant` (
`id`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增' ,
`offer_id`  bigint(20) NOT NULL DEFAULT '-1' COMMENT '订单ID' ,
`aname`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '姓名' ,
`idcard_type`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '证件类型' ,
`idcard_no`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '证件号' ,
