PRIMARY KEY (`id`),
INDEX `idx_offer_id` (`offer_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='投保人信息'
