-- ----------------------------
-- Table structure for t_vcar_car_info
-- ----------------------------
DROP TABLE IF EXISTS `t_vcar_car_info`;
CREATE TABLE `t_vcar_car_info` (
`id`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增' ,
`is_new`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '是否未上牌(必须),Y:新车，N：旧车(此参数必传)' ,
`price`  decimal(10,6) NOT NULL DEFAULT '-1.000000' COMMENT '新车发票价(新车未上牌或者初登日期小于9个月，此参数必传),-1需要处理成null' ,
`car_license_no`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '车牌号,  当is_new=Y时，此参数不传' ,
`vin_code`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '车架号.此参数必传' ,
`engine_no`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '发动机号,此参数必传' ,
`car_property`  varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '车辆使用性质,此值与车辆性质相匹配，默认家用车' ,
`property`  varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '车辆所属性质,此值与所属性质匹配，默认个人用车' ,
`regist_date`  date NOT NULL DEFAULT '1900-01-01' COMMENT '初登日期(默认时间为 null)此参数必传' ,
`is_transferCar`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '是否过户车 Y:新车，N：旧车' ,
`transfer_date`  date NOT NULL DEFAULT '1900-01-01' COMMENT '过户日期(默认时间为 null)' ,
`vehicle_name`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '车型名称' ,
`vehicle_id`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '车型ID此参数必传' ,
`model_loads`  decimal(10,0) NOT NULL DEFAULT '-1' COMMENT '核定载重量(货车必填)从接口获取的' ,
`purpose`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '车辆用途,此值与所属车辆用途' ,
`seat`  int(10) NOT NULL DEFAULT '-1' COMMENT '核定载客人数' ,
`full_weight`  decimal(10,0) NOT NULL DEFAULT '-1' COMMENT '整备质量' ,
`driving_area`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '行驶区域(此值与所属性质匹配)' ,
`created_time`  datetime NOT NULL COMMENT '创建时间' ,
`updated_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='车辆信息'
AUTO_INCREMENT=4

;

