`id`  bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增主键' ,
`reg_mobile`  varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '注册手机号' ,
`apply_password`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '客户端密码' ,
`gesture_password`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手势密码' ,
`payment_password`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付密码' ,
`open_id`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '绑定微信号' ,
`reg_source`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '注册来源(微信:WebChat,苹果:iOS,安卓:Android,网页:Web)' ,
`reg_channel`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'Official' COMMENT '渠道(官方：Official)' ,
`is_active`  tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否有效(true：有效,false:无效)注，非0有效，0无效' ,
`created_time`  datetime NOT NULL COMMENT '创建时间' ,
`updated_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`),
UNIQUE INDEX `un_reg_mobile` (`reg_mobile`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='客户表'
AUTO_INCREMENT=9

;

