-- ----------------------------
-- Table structure for t_vcar_delivery
-- ----------------------------
DROP TABLE IF EXISTS `t_vcar_delivery`;
CREATE TABLE `t_vcar_delivery` (
`id`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增ID' ,
`customer_id`  bigint(20) NOT NULL DEFAULT '-1' COMMENT '客户ID' ,
`delivery_type`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '配送方式快递=1，电子保单=2' ,
`recv_name`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人姓名' ,
`recv_mobile`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人手机号码' ,
`city_code`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '-1' COMMENT '市编码' ,
`area_code`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '-1' COMMENT '区编码' ,
`detail_address`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '详细地址(不包含省市区)' ,
`is_active`  tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否有效(true：有效,false:无效)注，非0有效，0无效' ,
`zip`  varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '邮编' ,
`express_company_name`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '快递公司名称' ,
`express_number`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '快递单号' ,
`sy_elec_policy_file_path`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商业险电子保单地址' ,
`jp_elec_policy_file_path`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '交强险电子保单地址' ,
`created_time`  datetime NOT NULL COMMENT '创建时间' ,
`updated_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`),
INDEX `idx_customer_id` (`customer_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='客户收货地址管理'
AUTO_INCREMENT=1

;

-- ----------------------------
-- Records of t_vcar_delivery
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for t_vcar_dictionary
-- ----------------------------
DROP TABLE IF EXISTS `t_vcar_dictionary`;
CREATE TABLE `t_vcar_dictionary` (
`id`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键自境' ,
`dtype`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '类型(注册协议:REG_PROTOCOL,银行卡:SYS_BANK)' ,
`is_active`  tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否有效(true：有效,false:无效)注，非0有效，0无效' ,
`dname`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '名称(后台使用)' ,
`dvalue`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '值(直接使用的)' ,
`system_defined_value`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '自定义类型值' ,
`sys_description`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '描述(后台使用)' ,
`front_title`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '前端标提(客户直接看到的)' ,
`front_description`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '前端描述(客户直接看到的)' ,
`sort`  int(2) NOT NULL DEFAULT 0 COMMENT '排序' ,
`control_type`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '控件类型(text:文本输入类型，select:下拉选择类型,image:图片上传类型)' ,
`validate_rules`  varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '校验类型：NOTNULL' ,
`created_user`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'System' COMMENT '创建人:默认系统创建，存储创建人)' ,
`created_time`  datetime NOT NULL COMMENT '创建时间' ,
`updated_user`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'System' COMMENT '更新人:默认系统创建' ,
`updated_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='系统字典表'
AUTO_INCREMENT=272

;

