-- ----------------------------
-- Table structure for t_vcar_efc_insure_info
-- ----------------------------
DROP TABLE IF EXISTS `t_vcar_efc_insure_info`;
CREATE TABLE `t_vcar_efc_insure_info` (
`id`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增' ,
`insure_info_id`  bigint(20) NOT NULL DEFAULT '-1' COMMENT '保险配置ID' ,
`start_date`  date NOT NULL DEFAULT '1900-01-01' COMMENT '交强险起保日期' ,
`end_date`  date NOT NULL DEFAULT '1900-01-01' COMMENT '交强险终保日期' ,
`amount`  decimal(10,6) NOT NULL DEFAULT 0.000000 COMMENT '交强险保额' ,
`premium`  decimal(10,6) NOT NULL DEFAULT 0.000000 COMMENT '上年交强险保费' ,
`policy_no`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '承保成功后才有交强险保单号' ,
`discount_rate`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '交强险折扣率' ,
`created_time`  datetime NOT NULL DEFAULT '1900-01-01 00:00:00' COMMENT '创建时间' ,
`updated_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`),
INDEX `idx_insure_info_id` (`insure_info_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='交强险'
AUTO_INCREMENT=2

;

