-- ----------------------------
-- Table structure for t_vcar_feedback
-- ----------------------------
DROP TABLE IF EXISTS `t_vcar_feedback`;
CREATE TABLE `t_vcar_feedback` (
`id`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键自增' ,
`customer_id`  bigint(20) NOT NULL DEFAULT '-1' COMMENT '用户ID' ,
`content`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '反馈内容' ,
`is_active`  tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否有效(true：有效,false:无效)注，非0有效，0无效' ,
`created_time`  datetime NOT NULL COMMENT '创建时间' ,
`updated_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='客户反馈'
AUTO_INCREMENT=5

;

