-- ----------------------------
-- Table structure for t_vcar_file_info
-- ----------------------------
DROP TABLE IF EXISTS `t_vcar_file_info`;
CREATE TABLE `t_vcar_file_info` (
`id`  bigint(12) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增' ,
`customer_id`  bigint(12) NOT NULL COMMENT '客户id' ,
`file_name`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '文件名（包含后缀名）' ,
`url`  varchar(180) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '文件访问地址' ,
`suffix`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '文件后缀名（如 .jpeg）' ,
`size`  bigint(12) NOT NULL COMMENT '文件大小' ,
`action_type`  tinyint(3) NOT NULL COMMENT '文件用途' ,
`description`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '描述' ,
`created_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间' ,
`updated_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='上传文件管理'
AUTO_INCREMENT=6

;

