-- ----------------------------
-- Table structure for t_vcar_request_url
-- ----------------------------
DROP TABLE IF EXISTS `t_vcar_request_url`;
CREATE TABLE `t_vcar_request_url` (
`id`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键ID' ,
`request_name`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '接口代表的意思（名字）' ,
`prefix_url`  varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'URL前缀' ,
`suffix_url`  varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'URL后缀（接口名字）' ,
`request_source`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '接口来源(如：泛华保网)' ,
`remark`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注' ,
`env`  varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '环境:测试(test)，开发(dev)，线上(prod)' ,
`is_active`  tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否可用（true：可用；false：不可用）' ,
`created_user`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'System' COMMENT '创建人:默认系统创建，存储创建人)' ,
`created_time`  datetime NOT NULL COMMENT '创建时间' ,
`updated_user`  varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'System' COMMENT '更新人:默认系统创建' ,
`updated_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='请求地址配置表'
AUTO_INCREMENT=15

;

